import React from "react";
import './card-list.style.css';

export const CardList = props => (

    <div className='card-list'> 

    {props.houses.map(house => (

      <h1 key={house.id}> {house.name}{
        console.log(props.houses)}</h1>
      ))}
    </div>
);
